const tasks = [
  {
    id: 1,
    text: "Doc",
    day: "9.10.2010",
    reminder: true,
  },
  {
    id: 2,
    text: "Dog",
    day: "9.10.2010",
    reminder: true,
  },
  {
    id: 3,
    text: "Mom",
    day: "9.10.2010",
    reminder: false,
  },
];
const Tasks = () => {
  return (
    <>
      {tasks.map((task) => (
        <h3 key={task.id}>{task.text}</h3>
      ))}
    </>
  );
};

export default Tasks;
